VALUES ('8000070016699', 'Stick', 'LES PLUS BELLES COULEURS DU NOIR Passionnés et experts, nos Maîtres Torréfacteurs mettent en ceuvre tout leur savoir-faire pour révéler le meilleur des arômes de chacun de nos cafés. Cette passion pour l\'excellence et l\'assemblage minutieux des meilleurs grains révèlent une richesse aromatique incomparable. Retrouvez le plaisir unique de Carte Noire, en café instantané. At Carte Noire our master roasters craft our blends with passion and expertise to release the finest aromas in each of our coffees. This passion for excellence and the meticulouUs blending of the best beans reveal the finest aromas. Rediscover the unique pleasure of Carte Noire in instant coffee. Cafe soluble lyophilisé Freeze dried instant coffee 144 g e (80 Stichs x 1,8 g-Les stichs ne peuvent être vendus séparément 80 Stichs x 1,8 g-Stichs not to be sold separately)', 'https://static.openfoodfacts.org/images/products/800/007/001/6699/front_fr.13.400.jpg', '', '', '', '', '', '', '', '', '', '1');

